import React, { Component } from 'react';
import axios from 'axios';
import NavbarHeader from './navbarhead';
import Timeslots from './Timeslots';
import './App.css';
class App extends Component {

  constructor(props) {
    super(props);

    this.state = {
      members: [],
    };
  }


  componentDidMount() {
    fetch('http://localhost:4000/purchase')
      .then(res => res.json())
      .then(members => this.setState({ members: members }));
  }

  render() {
    return (
        <div className="App">
          <NavbarHeader />
          <Timeslots />
          <div>
          {JSON.stringify(this.state.members)}
          </div>

        </div>
    )
  }
}

export default App;
